import React from 'react';
import arrow from './circled-right-2.png'
import './main.css';
import { Route, Link, BrowserRouter as Router, Switch } from 'react-router-dom'

function boton() {
    return (
        <div>
            <img src={arrow} className="Main-arrow" alt="Arrow" />
        </div>
    );
    }

export default boton
